import React, { useState } from "react";
import axios from "axios";
import './Login.css'
const Login = ({ handleLogin }) => {
  const [data, setData] = useState({
    email: "",
    password: "",
  });

  const handleChange = (e) => {
    const value = e.target.value;
    setData({
      ...data,
      [e.target.name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const userData = {
      email: data.email,
      password: data.password,
    };
    axios
      .post("https://reqres.in/api/login", userData)
      .then((response) => {
        console.log(response);
        handleLogin(true);
      })
      .catch((error) => {
        if (error.response) {
          console.log(error.response);
          console.log("server responded");
          alert("wrong");
        }
      });
  };
  return (
    <body class="container-fluid">

    <main class="row">

        <section class="col-md-6" id="panel-left">
            <div class="container align-self-center">
                <div class="row">
                    <h1 class="col-12 text-center">Dashboard</h1>
                </div>
                <div class="row">
                    <p class="col-12 text-center description">
                        Bienvenido, nos da gusto tenerte <br/> de nuevo aquí
                    </p>
                </div>
                <div class="row mt-5">                    
                    <div class="col-12 logo-container d-flex justify-content-center">
                        
                        </div>
                </div>
            </div>
        </section>


        <section class="col-md-6" id="panel-right">
            <div class="container">
                <div class="row mb-5">
                    <h2 class="col-12 text-center">Iniciar sesión</h2>
                </div>
                <div class="row">                    
                    <form action="#" class="col-12 col-md-8 offset-md-2">
                        <div class="form-group">
                            <input type="email" class="form-control" name="email" id="email" placeholder="Correo electrónico" required/>
                        </div>
                        <div class="form-group">
                            <input type="password" class="form-control" name="password" id="password" placeholder="Contraseña" required/>
                        </div>
                        <div class="form-group text-center pt-4">
                            <input type="submit" class="btn btn-primary" value="Ingresar"/>
                        </div>
                    </form>
                </div>
                <div class="row mt-5">
                    <div class="col-12 links text-center">
                        <div>
                            <a href="#">Olvide mi contraseña</a>
                        </div>
                        <div>
                            <a href="#">Crear cuenta</a>
                        </div>                        
                    </div>
                </div>
            </div>
        </section>
    </main>
</body>
  );
};

export default Login
